function _ChangeAttrs(t){t.hasAttribute("lazy-img")&&(t.src=t.getAttribute("lazy-img"),t.classList.remove("lazy-img")),t.hasAttribute("lazy-bg")&&(t.style.backgroundImage="url("+t.getAttribute("lazy-bg")+")",t.classList.remove("lazy-bg"))}document.addEventListener("DOMContentLoaded",function(){var t=[].slice.call(document.querySelectorAll(".lazy-img, .lazy-bg"));t.forEach(function(t){_ChangeAttrs(t)})});